function App() {
  return (
    <div style={{
      textAlign: 'center',
      padding: '20px',
      fontFamily: 'Arial, sans-serif'
    }}>
      <h1>Welcome to My Portfolio</h1>
      <nav style={{
        display: 'flex',
        justifyContent: 'center',
        gap: '20px'
      }}>
        <a href="https://github.com/kpang01" style={{color: '#0366d6'}}>GitHub</a>
        <a href="#projects" style={{color: '#0366d6'}}>Projects</a>
        <a href="#contact" style={{color: '#0366d6'}}>Contact</a>
      </nav>
    </div>
  );
}

export default App;
